WebServer::WebServer()
{}

WebServer::WebServer( const WebServer& w )
{(void)w;}

WebServer::WebServer( const Config* aConfig) :
mConfig(aConfig)
{}

WebServer::~WebServer()
{}

WebServer&	WebServer::operator=( const WebServer& w )
{
	(void)w;
	return (*this);
}

void	WebServer::start()
{
	mSocket.bind();
	mSocket.listen();
}

void	WebServer::loop()
{
	while (true){
		// ISocket*	clientSocket = s.accept();

		// clientSocket->setNonBlocking();

		// ClientSocket	c(clientSocket->getID());
		std::cout << "waiting for new client..." << std::endl;
		IClientSocket*	c = mSocket.accept();
		c->setNonBlocking();

		Request		req(*c);
		Response	res(*c);

		res.setStatusCode(400)
			.setHeader("content-type", "text/plain")
			.setHeader("connection", "close")
			.setBody(gBody)
			.build();

		try{
			req.build();
			req.dump();
		}
		catch(const std::exception& e)
		{
			std::cerr << e.what() << std::endl;
		}

		res.startSending();
		int	count = 0;
		while ( ! res.isSendingComplete() )
		{
			try {
				res.send();
				++count;
			}
			catch (const std::exception& e)
			{
				std::cerr << e.what() << std::endl << std::flush;
			}
		}
		std::cout << "Count: " << count << std::endl << std::flush;
		c->close();
		delete c;
	}
}
